import React from "react";

class App extends React.Component {
  constructor() {
    super();
    this.state = {
    value:1
  }
  }
  clickHandle = () => {
    this.setState({
      value:this.state.value+1
    })
  }
  render() {
    return (
      <div>
        <div>{this.state.value}</div>
        <button onClick={this.clickHandle}>+1</button>
      </div>
    )
  }
}

export default App;
